//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./utils/Pausable.sol";

import {InitializedProxy} from "./InitializedProxy.sol";

contract Factory is Ownable, Pausable {
  // 迁移到setting
  // 版本名 => 版本号 => 升级工具模板 => 是否是我们发布的安全升级 或 开关
  mapping(string => mapping(uint16 => mapping(address => bool))) public updataAddresCalibration;

  /// @notice the number of ERC721 vaults router
  uint256 public vaultRouterCount;
  
  /// @notice the mapping of vault number to vault router contract
  mapping(uint256 => address) public routers; 

  // The router address given by the user mint returns which router template he originally used 
  mapping(address => address) public calibrationTemplate;

  /// @notice a setting contract controlled by governance
  address public immutable setting;
  
  /// @notice the TokenVault logic contract
  mapping (address => bool) public routerTemplateMap;

  mapping (address => address) public lastMint;

  event Mint( address indexed router, address indexed template , uint256 vaultRouterCount);

  constructor(address setting_) {
    setting = setting_;
  } 
  
  function setUpdataAddresCalibration(string memory versionsName,uint16 versions,address updataTemplate,bool isOpen) external onlyOwner{
    updataAddresCalibration[versionsName][versions][updataTemplate] = isOpen;
  }

  function mint(address routerTemplate,string memory name) external whenNotPaused returns(uint256) {
    require(routerTemplateMap[routerTemplate], "Factory :: Incorrect template address");

    bytes memory _initializationCalldata = abi.encodeWithSignature(
      "initialize(address,address,string)",
      msg.sender,
      setting,
      name
    );

    address router = address(
      new InitializedProxy(
        routerTemplate,
        _initializationCalldata
      )
    );
    
    emit Mint( router, routerTemplate , vaultRouterCount);

    routers[vaultRouterCount] = router;
    lastMint[msg.sender] = router;
    calibrationTemplate[router] = routerTemplate;
    vaultRouterCount++;

    return vaultRouterCount - 1;
  }

  function setLogic(address router, bool ratify) external onlyOwner {
    routerTemplateMap[router] = ratify;
  }

  function pause() external onlyOwner {
    _pause();
  }

  function unpause() external onlyOwner {
    _unpause();
  }

}

contracts/InitializedProxy.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/utils/StorageSlotUpgradeable.sol";
/**
 * @title InitializedProxy
 * @author Anna Carroll
 */
contract InitializedProxy {
    // address of logic contract
    // slot bytes32(uint256(keccak256('EIP1967.PROXY.CONFTI.IMPLEMENTATION')) - 1)
    bytes32 internal constant _IMPLEMENTATION_SLOT = 0x5f62ce3c9aebd463c7a36ab1b244d2bb94f07a2c13889b3b687940ebc467b9b3;

    // ======== Constructor =========
    constructor(
        address logic,
        bytes memory initializationCalldata
    ) { 
        require(logic != address(0),"Proxy :: Logical contracts cannot be zero addresses");
        StorageSlotUpgradeable.getAddressSlot(_IMPLEMENTATION_SLOT).value = logic;
        // Delegatecall into the logic contract, supplying initialization calldata
        (bool _ok, bytes memory returnData) =
            logic.delegatecall(initializationCalldata);
        // Revert if delegatecall to implementation reverts
        require(_ok, string(returnData));
    }
     

    // ======== Fallback =========

    fallback() external payable {
        address _impl = StorageSlotUpgradeable.getAddressSlot(_IMPLEMENTATION_SLOT).value;
        assembly {
            let ptr := mload(0x40)
            calldatacopy(ptr, 0, calldatasize())
            let result := delegatecall(gas(), _impl, ptr, calldatasize(), 0, 0)
            let size := returndatasize()
            returndatacopy(ptr, 0, size)

            switch result
                case 0 {
                    revert(ptr, size)
                }
                default {
                    return(ptr, size)
                }
        }
    }

    // ======== Receive =========

    receive() external payable {} // solhint-disable-line no-empty-blocks
}

